var satoshi=parseInt(100000000);function Transaction(){}function Block(){}function BlockFromJSON(a){var b=new Block();b.hash=a.hash;b.time=a.time;b.nTx=a.n_tx;b.blockIndex=a.block_index;b.height=a.height;b.txIndex=a.txIndexes;return b}function toFixed(a,b){if(!parseInt(b)){var b=0}if(!parseFloat(a)){return 0}return Math.round(a*Math.pow(10,b))/Math.pow(10,b)}function TransactionFromJSON(c){var a=new Transaction();a.hash=c.hash;a.size=c.size;a.txIndex=c.tx_index;a.time=c.time;a.inputs=c.inputs;a.out=c.out;a.blockIndex=c.block_index;a.result=c.result;try{for(var b=0;b<a.inputs.length;b++){a.inputs[b].prev_out.addr=new Bitcoin.Address(Crypto.util.hexToBytes(a.inputs[b].prev_out.hash))}for(var b=0;b<a.out.length;b++){a.out[b].addr=new Bitcoin.Address(Crypto.util.hexToBytes(a.out[b].hash))}}catch(d){}return a}Transaction.prototype.setConfirmations=function(a){this.confirmations=a};function dateToString(a){return a.getFullYear()+"-"+a.getMonth()+"-"+a.getDate()+" "+a.getHours()+":"+a.getMinutes()+":"+a.getSeconds()}Transaction.prototype.getHTML=function(h){var a=this.result;var f='<div id="tx-'+this.txIndex+'"><table class="zebra-striped" cellpadding="0" cellspacing="0" style="padding:0px;float:left;margin:0px;margin-top:10px;"><tr><th colspan="4" style="font-weight:normal"><div class="hash-link">';if(a!=null){if(a>0){f+='<span class="label success">Payment Received</span>'}else{if(a<0){f+='<span class="label important">Payment Sent</span>'}else{if(a==0){f+='<span class="label">Funds Moved</span>'}}}}f+=' <a target="new" href="'+root+"tx-index/"+this.txIndex+"/"+this.hash+'">'+this.hash+'</a></div> <span style="float:right"><span class="can-hide"><b>';if(this.time>0){var d=new Date(this.time*1000);f+=dateToString(d)}var c="";if(a<0){c='class="can-hide"'}f+='</b></span></th></tr><tr><td width="55%" '+c+' style="vertical-align:middle;"><ul class="txul">';if(this.inputs.length>0){for(var e=0;e<this.inputs.length;e++){input=this.inputs[e];if(h!=null&&h[input.prev_out.addr]!=null){f+="<li>"+input.prev_out.addr+"</li>"}else{if(input.prev_out.hash==null||input.prev_out.hash.length==0){f+="<li><b>No Input (Newly Generated Coins)</b></li>"}else{f+='<li><a target="new" href="'+root+"address/"+input.prev_out.hash+'">'+input.prev_out.addr+"</a></li>"}}}}else{f+="<li>No inputs, transaction probably sent from self.</li>"}f+='</ul></td><td class="can-hide" style="padding:0px;width:48px;min-height:48px;vertical-align:middle;">';var b;if(a>=0){b="btn success";f+='<img src="'+resource+'arrow_right_green.png" />'}else{if(a<0){b="btn error";f+='<img src="'+resource+'arrow_right_red.png" />'}else{b="btn";f+="&nbsp;"}}var c="";if(a>=0){c='class="can-hide"'}f+='</td><td width="30%" '+c+' style="vertical-align:middle;"><ul class="txul">';for(var e=0;e<this.out.length;e++){output=this.out[e];if(h!=null&&h[output.addr]!=null){f+="<li>"+output.addr+"</li>"}else{f+='<li><a target="new" href="'+root+"address/"+output.hash+'">'+output.addr+"</a></li>"}}f+='</ul></td><td width="15%" style="vertical-align:middle;"><ul class="txul">';for(var e=0;e<this.out.length;e++){output=this.out[e];var g=output.value/100000000;f+='<li class="can-hide">'+g+" BTC</li>"}f+='</ul></td></tr></table><span style="float:right;padding-bottom:30px;clear:both;">';if(this.ip!=null&&this.ip.length>0){f+='<span class="adv"><i>Received from: <a href="'+root+"ip-address/"+this.ip+'">'+this.ip+'</a> <a href="http://www.dnsstuff.com/tools/ipall/?tool_id=67&ip='+this.ip+'" target="new">(whois)</a> - </span>'}if(this.confirmations==null){f+='<button class="confm" style="display:none"></button> '}else{if(this.confirmations==0){f+='<button class="btn error confm">Unconfirmed Transaction!</button> '}else{if(this.confirmations>0){f+='<button class="btn primary confm">'+this.confirmations+" Confirmations</button> "}}}f+='<button class="btn info">'+toFixed(Math.round((a/satoshi)*market_price*100)/100,2)+' USD</button> <button class="'+b+'">'+toFixed(a/satoshi,4)+" BTC</button></span></div>";return f};